pragma solidity >=0.4.21 <0.6.0;

import "../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./ExchangeOwners.sol";

//交易所数据合约
contract ExchangeData is ExchangeOwners {
    using SafeMath for *;

    mapping(uint64 => orders) public  orderIdToUsers;            //订单表
    mapping(address => tokens) public tokenTable;                //代币表
    mapping(uint64 => rollbackOrder)public rollbackOrderMap;     //事务回滚订单集合
    address[] public tokenArray;                                 //代币地址数组

    struct orders
    {
        uint64 order_id;                                         //订单id
        address user_address;                                    //用户地址
        string user_receiver;                                    //交易完成接收地址
        bool trade_type;                                         //交易类型
        uint256 sell_amount;                                     //卖的数量
        address sell_contract;                                   //卖方合约地址
        uint256 price;                                           //单价
        uint256 buy_amount;                                      //买的数量
        address buy_contract;                                    //买方合约地址
        uint256 fees;                                            //手续费
        bool withdraw_able;                                      //是否可撤销
        bool ex_success;                                         //是否完成交易
        uint256 create_at;                                       //创建时间
        uint256 update_at;                                       //更新时间
    }

    struct tokens
    {
        string token_name;                                       //代币名
        address token_address;                                   //代币地址
        uint8 decimals;                                          //代币精度
        uint64[50] market_code_array;                              //代币交易类型数组  2=eth,3=bdex
    }

    struct rollbackOrder
    {
        uint64 orderId;                                           //订单id
        address to;                                               //转账地址
        uint256 sellAmount;                                       //转账数量
        uint256 buyAmount;                                        //买的数量
        uint256 fee;                                              //手续费
    }


    //创建订单(普通权限调用)
    function createOrders(
        uint64 orderId,
        address userAddress,
        string  memory userReceiver,
        bool tradeType,
        uint256 sellAmount,
        address sellContract,
        uint256 price,
        address buyContract,
        uint64 market_code)
    public
    isOwners(msg.sender)
    {
        require(!isExistOrder(orderId), "ExchangeData:65");
        if (sellContract != address(0)) {
            require(isExistToken(sellContract, market_code), "ExchangeData:67");
        }
        if (buyContract != address(0)) {
            require(isExistToken(buyContract, market_code), "ExchangeData:70");
        }
        orders memory user = orders(
            orderId,
            userAddress,
            userReceiver,
            tradeType,
            sellAmount,
            sellContract,
            price,
            0,
            buyContract,
            0,
            true,
            false,
            now,
            now);
        orderIdToUsers[orderId] = user;
    }

    //修改订单(普通权限调用)
    function setOrder(
        uint64 orderId,
        uint256 sellAmount,
        uint256 buyAmount,
        uint256 fees,
        bool withdrawAble,
        bool exSuccess)
    public
    isOwners(msg.sender)
    {
        require(isExistOrder(orderId), "ExchangeData:101");
        orderIdToUsers[orderId].sell_amount = sellAmount;
        orderIdToUsers[orderId].buy_amount = buyAmount;
        orderIdToUsers[orderId].fees = fees;
        orderIdToUsers[orderId].withdraw_able = withdrawAble;
        orderIdToUsers[orderId].ex_success = exSuccess;
        orderIdToUsers[orderId].update_at = now;
    }
    //修改是否可以撤销订单状态(普通权限调用)
    function changeWithdrawStatus(uint64 orderId, bool status)
    public
    isOwners(msg.sender)
    {
        require(isExistOrder(orderId), "ExchangeData:114");
        orderIdToUsers[orderId].withdraw_able = status;
    }
    //撤销订单(普通权限调用)
    function withdrawOrder(uint64 orderId)
    public isOwners(msg.sender)
    returns (uint256 amount, address userAddress, address tokenContract)
    {
        require(isExistOrder(orderId), "ExchangeData:122");
        require(!orderIdToUsers[orderId].ex_success, "ExchangeData:123");
        require(orderIdToUsers[orderId].withdraw_able, "ExchangeData:124");

        amount = orderIdToUsers[orderId].sell_amount;
        userAddress = orderIdToUsers[orderId].user_address;
        tokenContract = orderIdToUsers[orderId].sell_contract;
        delete (orderIdToUsers[orderId]);
    }

    //订单成交修改数据(普通权限调用)
    function addSubmit(uint64 orderId, address to, uint256 sellAmount, uint256 buyAmount, uint256 feeAmount)
    public
    isOwners(msg.sender)
    {
        require(isExistOrder(orderId), "ExchangeData:137");
        require(!isExistRollbackOrder(orderId), "ExchangeData:138");
        require(!orderIdToUsers[orderId].ex_success, "ExchangeData:139");
        require(orderIdToUsers[orderId].sell_amount >= sellAmount.add(feeAmount), "ExchangeData:140");
        bool is_withdraw;
        bool is_success;
        if (orderIdToUsers[orderId].sell_amount > sellAmount.add(feeAmount)) {
            is_withdraw = true;
            is_success = false;
        } else {
            is_withdraw = false;
            is_success = true;
        }
        rollbackOrder memory rollbackMap = rollbackOrder(orderId, to, sellAmount, buyAmount, feeAmount);
        rollbackOrderMap[orderId] = rollbackMap;

        orderIdToUsers[orderId].sell_amount = orderIdToUsers[orderId].sell_amount.sub(sellAmount).sub(feeAmount);
        orderIdToUsers[orderId].buy_amount = orderIdToUsers[orderId].buy_amount.add(buyAmount);
        orderIdToUsers[orderId].fees = orderIdToUsers[orderId].fees.add(feeAmount);
        orderIdToUsers[orderId].withdraw_able = is_withdraw;
        orderIdToUsers[orderId].ex_success = is_success;
        orderIdToUsers[orderId].update_at = now;
    }
    //回滚订单(普通权限调用)
    function rollbackSubmit(uint64 orderId)
    public
    isOwners(msg.sender)
    {
        require(isExistRollbackOrder(orderId), "ExchangeData:165");
        orderIdToUsers[orderId].sell_amount = orderIdToUsers[orderId].sell_amount.add(rollbackOrderMap[orderId].sellAmount).add(rollbackOrderMap[orderId].fee);
        orderIdToUsers[orderId].buy_amount = orderIdToUsers[orderId].buy_amount.sub(rollbackOrderMap[orderId].buyAmount);
        orderIdToUsers[orderId].fees = orderIdToUsers[orderId].fees.sub(rollbackOrderMap[orderId].fee);
        orderIdToUsers[orderId].withdraw_able = true;
        orderIdToUsers[orderId].ex_success = false;
        orderIdToUsers[orderId].update_at = now;
        delete (rollbackOrderMap[orderId]);
    }
    //订单成交后获取转账信息(普通权限调用)
    function getTransferInfo(uint64 orderId)
    public
    isOwners(msg.sender)
    returns (uint256 sellAmount, address to, address tokenContract)
    {
        require(isExistRollbackOrder(orderId), "ExchangeData:180");
        sellAmount = rollbackOrderMap[orderId].sellAmount;
        to = rollbackOrderMap[orderId].to;
        tokenContract = orderIdToUsers[orderId].sell_contract;
        delete (rollbackOrderMap[orderId]);
    }
    //token交易对是否存在(内部调用)
    function isExistToken(address addr, uint64 market_code) view internal returns (bool){
        if (tokenTable[addr].token_address != address(0)) {
            return isExistMarketCodeArray(addr, market_code);
        } else {
            return false;
        }
    }
    //回滚订单是否已存在，true=已存在，false=不存在(内部调用)
    function isExistRollbackOrder(uint64 orderId)
    view internal
    returns (bool)
    {
        return (rollbackOrderMap[orderId].to == address(0)) ? false : true;
    }

    //订单是否已存在，true=已存在，false=不存在(内部调用)
    function isExistOrder(uint64 orderId)
    view internal
    returns (bool)
    {
        return (orderIdToUsers[orderId].user_address == address(0)) ? false : true;
    }
    //添加交易对(最高权限调用)
    function addTokens(
        string  memory token_name,
        address token_address,
        uint8 decimals,
        uint64 market_code
    )
    public
    isContractOwner(msg.sender)
    {
        require(token_address != address(0), "ExchangeData:219");
        require(bytes(token_name).length != 0, "ExchangeData:220");
        require(market_code != 0, "ExchangeData:221");
        require(decimals > 0, "ExchangeData:222");

        if (tokenTable[token_address].token_address == address(0)) {
            tokenTable[token_address].market_code_array[0] = market_code;
            tokenTable[token_address].token_name = token_name;
            tokenTable[token_address].token_address = token_address;
            tokenTable[token_address].decimals = decimals;
            tokenArray.push(token_address);
        } else {
            require(!isExistMarketCodeArray(token_address, market_code), "ExchangeData:231");
            uint64 index = getMarketCodeArrayNullIndex(token_address);
            tokenTable[token_address].market_code_array[index] = market_code;
        }

    }
    //删除交易对(最高权限调用)
    function deleteToken(address token_address, uint64 market_code) public isContractOwner(msg.sender) {
        require(market_code != 0, "ExchangeData:239");
        require(tokenTable[token_address].token_address != address(0), "ExchangeData:240");
        for (uint64 i = 0; i < 50; i++) {
            if (tokenTable[token_address].market_code_array[i] == market_code) {
                delete (tokenTable[token_address].market_code_array[i]);
            }
        }
    }
    //对应代币下是否支持该marketCode交易对(内部调用)
    function isExistMarketCodeArray(address addr, uint64 code) view internal returns (bool){
        for (uint64 i = 0; i < 50; i++) {
            if (tokenTable[addr].market_code_array[i] == code) {
                return true;
            }
        }
        return false;
    }
    //获取数组中空值下标(内部调用)
    function getMarketCodeArrayNullIndex(address addr) view internal returns (uint64){
        for (uint64 i = 0; i < 50; i++) {
            if (tokenTable[addr].market_code_array[i] == 0) {
                return i;
            }
        }
        return 0;
    }
    //根据地址查询代币信息(公开接口)
    function getTokenInfo(address tokenAddress) 
    view 
    public 
    returns (
        string memory token_name, 
        address token_address, 
        uint8 decimals, 
        uint64[50] memory market_code_array
        ){
        token_name = tokenTable[tokenAddress].token_name;
        token_address = tokenTable[tokenAddress].token_address;
        decimals = tokenTable[tokenAddress].decimals;
        market_code_array = tokenTable[tokenAddress].market_code_array;
    }

    //获取所有代币地址(公开接口)
    function getTokenArray()
    public view
    returns (address[] memory)
    {
        return tokenArray;
    }
}
